    [],nt"revision_timestamp": "2016-07-27T22:19:46.120295",nt"name": "effects-of-haying-and-grazing-on-duck-production-in-the-blitzen-valley-unit-12-of-malheur-",nt"isopen":
    false,nt"url": null,nt"notes": "This report is about a study that was done
    at Malheur National Wildlife Refuge to determine the effects that haying and grazing
    have on duck production.  Three patterns of management were compared: traditional
    agricultural use of mowing in the summer followed by grazing in the winter, late
    summer mowing without grazing, and no mowing or grazing (idle treatment).  Plots
    were set up using each of the management practices and searches for nests were conducted
    every three weeks.  The sample size of nests found was low for all plots, but the
    tentative results of the study indicate that tall grass from the idle treatment
    was the favored nesting habitat for ducks.",nt"license_title": "License Not
